///
/// SMAA edge vertex shader.
///
inline constexpr const char* const smaa_edge_vert = R"(
    layout (location = 0) in vec3 l_pos;
    layout (location = 1) in vec2 l_texels;

    out vec2 texcoord;
    out vec4 offset[3];
    out vec4 dummy2;

    void main()
    {
	    texcoord = l_texels;
	    gl_Position = vec4(l_pos, 1.0);
	
	    vec4 dummy1 = vec4(0);
	    SMAAEdgeDetectionVS(dummy1, dummy2, texcoord, offset);
    }
)";

///
/// SMAA edge frag shader.
///
inline constexpr const char* const smaa_edge_frag = R"(
    in vec2 texcoord;
    in vec4 offset[3];
    in vec4 dummy2;

    out vec4 frag_colour;

    uniform sampler2D neighbour_tex;

    void main()
    {
	    #if SMAA_PREDICATION == 1
            frag_colour = SMAAColorEdgeDetectionPS(texcoord, offset, neighbour_tex, depthTex);
	    #else
            frag_colour = SMAAColorEdgeDetectionPS(texcoord, offset, neighbour_tex);
	    #endif
    }
)";

